import styled from "styled-components";

import { ICoupon } from "@interfaces";

interface IProps {
    data: ICoupon;
}

export const ComponentHistoryCoupon = (props: IProps) => {
    const { data } = props;
    console.log(data);
    return (
        <StyledContainer>
            <div className="coupon">
                <div className="title">Coupon (50% off delivery)</div>
            </div>
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    padding: 18px 14px;
`;
